const cnst_bg = require("../../assets/cnst_bg4.jpg").default;
const Construction = () => {
  return (
    <div>
      <img src={cnst_bg} style={styles.image} />
      <div style={{ position: "absolute" }}>
        <h3>We build quality Homes</h3>
        <p>100% Hassle-Free and Managed by us!</p>
      </div>
      <header>
        <h3> Welcome to my Blog </h3>
        <p> FREEEEDOM </p>
      </header>
    </div>
  );
};

const styles = {
  bg: {
    backgroundImage: `url(${cnst_bg})`,
    backgroundRepeat: "no-repeat",
    backgroundPosition: "center",
    backgroundSize: "",
    width: "100vw",
    height: "80vh",
    textAlign: "center",
  },
  p: {
    fontSize: 25,
    marginTop: "15%",
    textAlign: "center",
    maxWidth: 700,
  },
  image: {
    width: "100%",
    // height: "10",
  },
};
export default Construction;
